```{.r .cell-code}
open_quick <- \(alias) {
  stopifnot(length(alias) == 1L)

  if (grepl("^profile|^state|^national", alias, perl = TRUE))
    return(prop(openMain(alias), "identifier") |> quick_open())
  else
    return(prop(openTemp("general"), "endpoints") |> _[["identifier"]] |> _[[1]] |> quick_open_temp())
}
```
