tictoc::tic()
request("https://openpaymentsdata.cms.gov/api/1/datastore/sql") |> 
  req_url_query(
    query = paste0(
      '[SELECT * FROM 08e796b8-7108-561a-8430-bea3bd54e485]',
      '[LIMIT 500 OFFSET 0]',
      '[WHERE covered_recipient_last_name = "SMITH"]'
      ),
    show_db_columns = "true"
  ) |> 
  perform_simple() |> 
  as_tbl() |> 
  map_na_if() |> 
  handle_na()
tictoc::toc()
